URL = "https://pokemondb.net/pokedex/all"
IMAGE_URL = "https://img.pokemondb.net/artwork/large/"

def request_url(URL):
    source = requests.get(URL).text
    soup = BeautifulSoup(source, 'lxml')
    return soup

def build_pokedex(soup):
    pokedex = {}

    pokedex_html = soup.find("table", {"id": "pokedex"})

    pokedex_data_html =  pokedex_html.tbody.find_all("tr")
    for row in pokedex_data_html:
        number = row.td.find("span", class_="infocard-cell-data").text
        name = row.find("td", "cell-name").text
        total = row.find("td", "cell-total").text
        typings = [t.get_text() for t in row.find_all("td", class_="cell-icon")]
        stats = [stat.get_text() for stat in row.find_all("td", class_="cell-num")[1:]]

        
        icon = f"https://img.pokemondb.net/artwork/{name.lower()}.jpg"

        if name not in pokedex:
            pokedex[name] = {"#": number, "typings": typings, "hp": stats[0], "attk": stats[1], "def": stats[2], "sp.attk": stats[3], "sp.def": stats[4], "speed": stats[5] ,"total": total, "icon": icon}
        
    return pokedex

