    def update_ui(self):
        name = self.pokemon_select.currentText()
        pokemon = self.pokedex_obj[name]

        number = pokemon["#"]
        hp = pokemon["hp"]
        typing = " ".join(pokemon["typings"])
        attack = pokemon["attk"]
        defence = pokemon["def"]
        spattack = pokemon["sp.attk"]
        spdefence = pokemon["sp.def"]
        speed = pokemon["speed"]
        total = pokemon["total"]
        image_url = pokemon["icon"]
        

        self.name_label.setText(f"Name: {name}")
        self.name_label.adjustSize()
        self.number_label.setText(f"Number: {number}")
        self.number_label.adjustSize()
        self.hp_label.setText(f"HP: {hp}")
        self.hp_label.adjustSize()
        self.type_label.setText(f"Type: {typing}")
        self.type_label.adjustSize()
        self.attack_label.setText(f"Attack: {attack}")
        self.attack_label.adjustSize()
        self.defence_label.setText(f"Defence: {defence}")
        self.defence_label.adjustSize()
        self.spattack_label.setText(f"Sp. Attack: {spattack}")
        self.spattack_label.adjustSize()
        self.spdefence_label.setText(f"Sp. Defence: {spdefence}")
        self.spdefence_label.adjustSize()
        self.speed_label.setText(f"Speed: {speed}")
        self.speed_label.adjustSize()
        self.total_label.setText(f"Total: {total}")
        self.total_label.adjustSize()

        self.groupBox.adjustSize()
        
        req = requests.get(image_url)
        pixmap = QPixmap()
        pixmap.loadFromData(req.content)

        self.image_box.setPixmap(pixmap)
        self.image_box.show()
        
